import ContactPerson from "./ContactPerson";
import classes from "./ContactList.module.css";

function ContactList() {
    return (
        <>
            <div className={classes.listContainer}>
                <h2 className={classes.title}>聊天室</h2>
                <ul>
                    <ContactPerson />
                    <ContactPerson />
                    <ContactPerson />
                    <ContactPerson />
                    <ContactPerson />
                    <ContactPerson />
                    <ContactPerson />
                    <ContactPerson />
                    <ContactPerson />
                    <ContactPerson />
                    <ContactPerson />
                    <ContactPerson />
                </ul>
            </div>
        </>
    );
}

export default ContactList;
